import React from 'react';
import Link from 'next/link';

import logo from 'src/assets/images/logo.svg';

import { StyledHeader, Logo } from './styles';

const Header = () => (
  <StyledHeader>
      <Link href="/">
    <Logo>
        <img src={logo} alt="rick and morty" />
    </Logo>
      </Link>
  </StyledHeader>
);

export default Header;
